The == operator in Java is used for comparing two variables or objects based on their memory addresses, not their values. This means that even if two variables refer to the same object (e.g., String), they will have different memory addresses, so the == comparison will return false.

In contrast, the equals() method checks whether two Strings contain identical characters in the same order and returns true only if they do. If you want to check if two strings are equal, including case sensitivity and special character handling, then use the equals() method:

```java
String s1 = "Java";
String s2 = "JAVA";

if (s1.equals(s2)) {
    System.out.println("Strings are equal");
} else {
    System.out.println("Strings are not equal");
}
```

This way of checking equality avoids issues with memory address comparisons which can sometimes lead to unexpected results.

So, generally speaking:
- Use == when comparing references (memory addresses).
- Use equals() when comparing the content or value of an Object/String.

In your specific situation where you had encountered a bug with changing a variable from == to .equals(), this was likely due to some sort of reference-based issue, rather than the actual string content being different. It seems you made the right decision switching from == to equals(). The fix was to use equals() because it provides more accurate string comparison functionality. 

Remember, in programming, understanding and applying the appropriate methods like equals() ensures code works as intended across different platforms and environments.

