        long logNBase3 = Math.log(n) / Math.log(3);

        // If the result is an exact power of log base 3 of any positive integer,
        // then 'n' is a power of 3.
        return logNBase3 >= 0 && logNBase3 == ((long)Math.pow(3, logNBase3));
    }

    public static void main(String[] args) {
